import { init, RuntimeMetadata } from 'merkleized-metadata';
import { assert } from "chai";

// curl -H "Content-Type: application/json" -d '{"id":1, "jsonrpc":"2.0", "method": "state_getMetadata"}' http://localhost:9967/
const MANTA_METADATA = "";

describe('Metadata Hash Test', () => { 
    it('Generate metadata hash should work', async () => {
        const mm = await init();
        console.log("Initialized");

        const runtimeMetadata = RuntimeMetadata.fromHex(MANTA_METADATA);
        const digest = mm.generateMetadataDigest(runtimeMetadata, {
            base58Prefix: 77,
            decimals: 18,
            specName: "manta",
            specVersion: 4720,
            tokenSymbol: "MANTA"
        });

        console.log("Metadata Hash:", digest.hash())
    }).timeout(20000);
});
